import React from "react";
import { Row, Col} from 'reactstrap'

function MemberItem({ image, name, position }) {
    return (

        <div className="menuItem">
            <div>
                <Row>
                    <Col>
                        <img style={{ backgroundImage: `url(${image})`}}/>
                    </Col>
                </Row>
            </div>
            <div className="menuDetail" style={{height:100, borderRadius:15}}>
                <h2> {name} </h2>
                <h3> {position} </h3>
            </div>
        </div>
    );
}

export default MemberItem;
